import SignIn from '~/pages/SignIn';
import SignUp from '~/pages/SignUp';

const routes = [
  {
    path: '/sign-in',
    Component: SignIn
  },
  {
    path: '/sign-up',
    Component: SignUp
  },
  {
    path: '/',
    Component: SignIn
  }  
];

export default routes;
